import {useState, useEffect} from 'react'
import './Money.css'


const Money = () => {

useEffect(()=>{
  fetch("https://economia.awesomeapi.com.br/EUR-BRL/10?start_date=20200201&end_date=20250301").then((resp)=> {console.log(resp)})

},[])

  return (
    <div className='money-div'>
            <div className="box-header">
                <h6>Cotação</h6>
            <img src="./../../../img/icons/btnpurper.svg" alt="Ver mais" />
            </div>
    </div>
  )
}

export default Money
